import React from "react";
import "./App.css";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import Home from './content/Home'
import AboutMe from './content/AboutMe'
import ContactMe from "./content/ContactMe";
import Hobbies from "./content/Hobbies";
import Projects from "./content/Projects";
import WorkHistory from "./content/WorkHistory";
import NavBar from "./components/NavBar";

const Footer = () => {
  return <div id ="footer"><Link to="/"><Button variant="contained" color="primary">
      Home
    </Button></Link>
    <Link to="/aboutme"><Button variant="contained" color="primary">
      About Me
    </Button></Link>
    <Link to="/hobbies"><Button variant="contained" color="primary">
      Interests
    </Button></Link>
    Copyright: Allan Hall inc
    <Link to="/workhistory"><Button variant="contained" color="primary">
      Work History
    </Button></Link>
    <Link to="/contactme"><Button variant="contained" color="primary">
      Contact Me
    </Button></Link>

    </div>;
};

const NotFound = () => {
  return (
    <div>
      <h2>404 Page Not Found</h2>
    </div>
  )
}



function App() {
  return (
<BrowserRouter>
  <NavBar />
  <Switch>
  <Route exact path="/" component={Home} />
  <Route path="/aboutme" component={AboutMe} />
  <Route path="/projects" component={Projects} />
  <Route path="/hobbies" component={Hobbies} />
  <Route path="/workhistory" component={WorkHistory} />
  <Route path="/contactme" component={ContactMe} />
  <Route path='*' component={NotFound} />
  </Switch>
  <Footer />
</BrowserRouter>
  );
}

export default App;
